import React, { Component } from "react";
import axios from "axios";
class Movie extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [],
      isLoaded: false
    };
  }

  componentWillMount() {
    axios
      .get("http://www.omdbapi.com/?i=tt3896198&apikey=539d07a9")
      .then(res => {
        this.setState({
          items: res.data
        });
      });
  }

  render() {
    let items = this.state.items.map(item => {
      return (
        <tr key={item.id}>
          <td>{item.id}</td>
          <td>
            <button>Search</button>
          </td>
        </tr>
      );
    });
    return (
      <div>
        <table>
          <thead>
            <tr>
              <th>Name:</th>
              Fetching data...
            </tr>
          </thead>
          <tbody></tbody>
        </table>
      </div>
    );
  }
}

export default Movie;
